import Counter from "./counter";

export default class Counteres extends Component {
    state = {
        counters: [
            { id: 1, value: 0},
            { id: 1, value: 0},
            { id: 1, value: 0},
      ]
  };
  render() {
    return (
      <React.Fragment>
        <Counter />
        <Counter />
        <Counter />
        <Counter />
      </React.Fragment>
    );
  }
}
